// frontend/src/components/Reports.js
import React from 'react';
import { Container, Typography, Paper, Grid } from '@mui/material';

const Reports = () => {
  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Reports
      </Typography>
      <Paper elevation={3} style={{ padding: '16px', marginBottom: '16px' }}>
        <Typography variant="h6">Performance Report</Typography>
        <p>Total profit/loss, win/loss ratio, etc.</p>
      </Paper>
      <Paper elevation={3} style={{ padding: '16px' }}>
        <Typography variant="h6">Custom Reports</Typography>
        <p>Generate custom reports based on criteria</p>
      </Paper>
    </Container>
  );
};

export default Reports;
